import React from 'react';
import { Container } from 'react-bootstrap';

const Footer = () => {
    return (
        <footer className="bg-dark text-white mt-5 p-4 text-center">
            <Container>
                <p>AwningBuddy</p>
            </Container>
        </footer>
    );
};

export default Footer;
